Bodyguard: A New Beginning (2008) 

Verenigd Koninkrijk
Actie / Drama
95 minuten

geregisseerd door Chee Keong Cheung
met Richard Ng, Vincent Sze en Stephanie Langton

Leung is een man uit Hong Kong, werkzaam als bodyguard voor de Chinese triadeleider, Wong. Leung stemt in met het verzoek van Wong om naar het Verenigd Koninkrijk af te reizen, om daar een jonge vrouw te beschermen. Niemand kent de ware identiteit van deze vrouw, alleen Wong weet wie ze is. Al snel wordt Leung hierdoor verwikkeld in een donker plot, vol bedrog en verraad.

